create table film
(
    id                 int auto_increment
        primary key,
    titolo             varchar(255) not null,
    data_pubblicazione date         not null,
    descrizione        text         not null,
    trailer            varchar(255) null,
    durata             int          not null,
    copertina          mediumblob   not null,
    constraint unique_titolo_data_pubblicazione
        unique (titolo, data_pubblicazione),
    constraint chk_durata_positive
        check (`durata` > 0)
);

INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (1, 'Titanic', '1997-12-19', 'Rose ha diciassette anni, una madre egoista, un fidanzato facoltoso e una vita pianificata. Imbarcata sul Titanic e insoddisfatta della propria subalternità al futuro sposo incontra Jack, romantico disegnatore della terza classe che ha vinto a poker un biglietto per l\'America. Contro le convenzioni e il destino, che chiederà il conto in una notte senza luna, Rose e Jack si innamorano, spiegando il loro spirito come i motori del più grande transatlantico del mondo. Lanciato nella sua prima traversata oceanica il Titanic è colpito al cuore da un iceberg, \'affondando\' millecinquecento persone e il futuro dei due giovani amanti. Ottantaquattro anni dopo l\'ultracentenaria Rose, scampata al naufragio e sopravvissuta a Jack, racconterà a un gruppo di scienziati la meraviglia di un amore interclassista e la stupidità di un mondo diviso in classi. Un mondo che il Titanic inabisserà in un oceano nero il 15 aprile del 1912.', 'https://www.youtube.com/embed/DP-AelnPZwc', 194, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (2, 'Il Signore degli Anelli: La Compagnia dell\'Anello', '2001-12-19', 'Bilbo Baggins ha deciso di celebrare il suo centoundicesimo compleanno in maniera molto particolare;alla fine della festa, abbandona parenti, amici, conoscenti e il suo affezionato nipote Frodo, cui lascia ogni cosa. Lo stregone Gandalf insiste perché lo hobbit lasci a Frodo anche il suo anello magico, su cui intende tenere un occhio vigile e fare alcune ricerche, perché potrebbe celare un mistero più inquietante di quanto non sembri. E così è; quello di Bilbo è l\'Unico Anello, l\'Anello per domarli, il cuore del potere del malefico Signore Oscuro Sauron, che sta tornando a tessere le sue trame di conquista e distruzione. Per impedirgli di vedere realizzato il suo sanguinoso disegno, l\'anello dovrà essere distrutto, cosa possibile soltanto nella fornace di Monte Fato, dove Sauron, secoli prima, lo forgiò.', 'https://www.youtube.com/embed/DSyjf8aNcPQ', 178, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (3, 'Il Padrino', '1972-03-24', 'Anni Quaranta. Come è consuetudine, durante il rinfresco per festeggiare le nozze della figlia Conny con Carlo, il "padrino" don Vito Corleone promette assistenza e protezione a familiari e amici. Invia il figliastro Tom Hagen in California per convincere in ogni modo il produttore Jack Woltz a scritturare il cantante Johnny nel suo prossimo film. Woltz non acconsente. Tom allora lo costringe ad accettare con un "avvertimento": l\'uccisione del suo cavallo di razza preferito. Sollozzo, a nome della potente "famiglia" Tartaglia, chiede a Corleone finanziamenti e appoggi per il traffico di droga. Il rifiuto scatena una lotta cruenta tra le due cosche: lo stesso don Vito viene ferito gravemente; il figlio minore Michael lo salva da un secondo attentato. Michael, poi, scavalcando l\'irruento fratello Sonny e Tom, temporeggiatore, organizza un incontro con Sollozzo e con il corrotto capitano di polizia McCluskey uccidendoli entrambi.', 'https://www.youtube.com/embed/9NoJZeytdqE', 175, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (4, 'Forrest Gump', '1994-07-06', 'Forrest Gump - un ragazzo non proprio idiota, ma dal basso coefficiente d\'intelligenza - racconta la sua storia a coloro che, uno dopo l\'altro, si siedono vicino a lui in attesa dell\'autobus. È stato in Vietnam, ha stretto la mano a tre presidenti, ha incontrato Elvis, ha assistito ai movimenti studenteschi, ha casualmente fatto esplodere il Watergate, ha suggerito le parole di "Imagine" a John Lennon e per tutta la vita è stato innamorato di una ragazza conosciuta fin da bambino.', 'https://www.youtube.com/embed/GKe68fGdNaw', 142, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (5, 'Pulp Fiction', '1994-10-14', 'Le vite di due gangster, di un pugile e della moglie di un potente boss della malavita finiscono per intrecciarsi in una paradossale storia di violenza, vendetta e redenzione.', 'https://www.youtube.com/embed/mg0GqZmoM9M', 154, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (6, 'Inception', '2010-07-16', 'Dom Cobb possiede una qualifica speciale: è in grado di inserirsi nei sogni altrui per prelevare i segreti nascosti nel più profondo del subconscio. Viene contattato da Saito, un potentissimo industriale di origine giapponese, il quale gli chiede di tentare l\'operazione opposta. Non deve prelevare pensieri celati ma inserire un\'idea che si radichi nella mente di una persona. Costui è Robert Fischer Jr. il quale, alla morte dell\'anziano e dittatoriale genitore, dovrà convincersi che l\'unica cosa che può fare è distruggere l\'impero ereditato. Saito avrà allora campo libero. In cambio offrirà a Cobb la possibilità di rientrare negli Stati Uniti dove è ricercato per omicidio. Cobb accetta e si fa affiancare da un team di cui entra a far parte la giovane Ariane, architetto abilissimo nella costruzione di spazi virtuali.', 'https://www.youtube.com/embed/gzhcWpzUUIg', 148, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (7, 'Schindler\'s List', '1993-11-30', 'Tratto dal libro di Thomas Keneally è la vera storia di Oscar Schindler, industriale tedesco, che nel 1938 capisce che è bene legarsi ai comandanti militari. Li frequenta nei locali notturni, offre bottiglie preziose. Quando gli ebrei sono relegati nel ghetto di Cracovia Schindler riesce a farsene assegnare alcune centinaia come operai in una fabbrica di pentole. All\'inizio sembra sfruttarli, in realtà li salva. Di fronte alla persecuzione tremenda, il tedesco trasforma quella sua prima iniziativa in una vera missione, fino a comprare letteralmente le vite di quasi milleduecento ebrei (la famosa lista) che sicuramente morirebbero nel campo di Auschwitz.', 'https://www.youtube.com/embed/SW4eNdZXl7Q', 195, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (8, 'Fight Club', '1999-09-21', 'Un uomo di trent\'anni è insofferente su tutto e la notte non riesce più a dormire. In cerca di qualche luogo dove scaricare la propria ansia si mette a frequentare quei corsi dove gruppi di malati gravi si riuniscono e confessano agli altri le rispettive situazioni. Mentre si lascia andare alla commozione e al pianto di fronte a quello che vede, l\'uomo fa la conoscenza prima di Marla Singer poi di Tyler Durden. Lei è una ragazza a sua volta alla deriva, incapace di scelte o decisioni; lui è un tipo deciso e vigoroso con un\'idea precisa in testa. Tyler fa saltare per aria l\'appartamento dell\'uomo e i due vanno a vivere insieme in una casa fatiscente. Deciso a coinvolgerlo nel suo progetto, Tyler lo fa entrare in un \'Fight Club\', uno stanzone sotterraneo dove ci si riunisce per picchiarsi e in questo modo sentirsi di nuovo vivi...', 'https://www.youtube.com/embed/ZhkXr2kf1x0', 139, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (9, 'Il Cavaliere Oscuro', '2008-07-18', 'Il crimine organizzato a Gotham City ha le ore contate. Batman, il tenente Gordon, il nuovo Procuratore Distrettuale e alcuni improbabili epigoni dell\'Uomo Pipistrello in imbottiture da hockey hanno dichiarato guerra ai criminali. La loro fortuna e i loro dollari, accumulati in una banca di massima sicurezza, vengono rubati da Joker, un pagliaccio sadico e mascherato che getterà la città nel disordine e nell\'anarchia. Riempite le tasche di lame, polvere da sparo e lanugine, Joker sfiderà il cavaliere oscuro di Bruce Wayne e rivelerà il lato oscuro di Harvey Dent, l\'eroe procuratore che applica la giustizia e agisce a volto scoperto.', 'https://www.youtube.com/embed/6Mvl_s-9clE', 152, );
INSERT INTO moviemania.film (id, titolo, data_pubblicazione, descrizione, trailer, durata, copertina) VALUES (10, 'Il Gladiatore', '2000-05-05', 'Dopo una vittoria contro i Britanni l\'imperatore Marco Aurelio (Harris), che disprezza il figlio Commodo (Phoenix), decide che il suo successore sarà il generale Massimo (Crowe), uomo straordinario, amato da tutti. Ma Commodo uccide il padre e ordina la morte del generale e della sua famiglia. Massimo fugge in Africa, diventa gladiatore, torna a Roma dove si fa riconoscere. Diventa l\'eroe del Colosseo, idolatrato dal popolo. Tanto che lo stesso Commodo non può farlo uccidere. Lo sfida a un duello nell\'arena, dopo averlo vigliaccamente ferito. Massimo uccide finalmente l\'orrendo imperatore.', 'https://www.youtube.com/embed/axcaKnZh9ZY', 155, );
